// export default Register
import React, { useState } from "react";
import axios from "axios";
import Nav from "./Nav";

const Register = () => {
  const [user, setUser] = useState("");
  const [pass, setPass] = useState("");
  const [atype, updateType] = useState("danger");
  const [alert, ualert] = useState({ display: "none" });
  const [message, umessage] = useState("");
  const [error, setError] = useState(null); // New error state

  const sendMessage = (text, type = "danger", time = 5) => {
    updateType(type);
    umessage(text);
    ualert({ display: "block" });
    setTimeout(() => {
      ualert({ display: "none" });
      if (type === "success") document.location.replace("/login");
    }, time * 1000);
  };

  const submit = (e) => {
    e.preventDefault();

    if (user.length < 3 || pass.length < 3) {
      return sendMessage("Please fill the form correctly!!");
    }

    axios
      .post("http://localhost:5000/api/register", { user, pass }, {
        headers: {
          "Content-Type": "application/json",
        },
      })
      .then((response) => {
        const data = response.data;
        if (data.status) {
          sendMessage(data.message, "success");
        } else {
          setError(data.message); // Set the error message in the state
        }
      })
      .catch((error) => {
        console.error("Error:", error);
        setError("An error occurred during the request."); // Set the error message in the state
      });
  };

  return (
    <>
    <Nav />
      <div className={`alert alert-${atype}`} style={alert} role="alert">
        {message}
      </div>

      {/* Add this block to display error messages */}
      {error && (
        <div className="alert alert-danger" role="alert">
          {error}
        </div>
      )}

      <div className="container mt-5">
        <div className="card">
          <div className="card-body">
            <form>
              <div className="mb-3">
                <label htmlFor="username" className="form-label">
                  Username
                </label>
                <input
                  type="text"
                  className="form-control"
                  onChange={(e) => setUser(e.target.value)}
                  id="username"
                />
              </div>
              <div className="mb-3">
                <label htmlFor="password" className="form-label">
                  Password
                </label>
                <input
                  type="password"
                  className="form-control"
                  onChange={(e) => setPass(e.target.value)}
                  id="password"
                />
              </div>
              <button onClick={(e) => submit(e)} className="btn btn-primary">
                Register
              </button>
            </form>
          </div>
        </div>
      </div>
    </>
  );
};

export default Register;
